import { Divider } from 'semantic-ui-react';
import NavButtons from './buttonGroup';

function App() {
  return (
    <div className = "App">

      <div className = 'nav'>


        <div className = 'SiteNavTitle'>

          <h1
          className = 'NavTitle'>

            Wills Stern

          </h1>





        </div>

          <div
          className = 'MediaButton'>
            <NavButtons />
          </div>


          <Divider />

      </div>




    </div>
  );
}

export default App;
